import './ExpenseItem.css'

function ExpenseItem(props) {
    const year = props.date.getFullYear()
    return (
        <div className='expense-card'>
            <div className='expense-card__date'><p>{year}</p></div>
            <div className='expense-card__product'><h3>{props.title}</h3></div>
            <div className='expense-card__price'><h3>{props.amount}$</h3></div>
        </div>
    )
}

export default ExpenseItem;
